<div class="product_title">
垂直昇降（シザース）型　手押し式高所作業台　 ENHLシリーズ</div>
<div class="main_content_area">
<div class="content_box_table">
<p class="auto-style1">
・移動は人力、昇降は電動の手押し式高所作業台！<br>
　ショッピングセンターでの商品搬入・照明取替・POP貼り、マンション内装工事、プラントでの計装配線の点検など<br>
　さまざまなシーンで活躍します。軽量・コンパクト設計なのでドアの通過やエレベータへの積載も可能です。</p>
<p>
・特別教育、特定自主検査不要です！！！</p>
</div>
<div class="page_top">
&nbsp;</div>
<div class="content_box_table">
<img alt="スペース" height="20" src="http://www.rakuten.ne.jp/gold/auc-mikawa-kiko/images/20airman/enhl036_02.gif" width="400">
