らくノリ君　特長</div>
<table class="prduct_content_table">
<tbody>
<tr>
<td>
<img alt="ENHL" height="660" src="http://www.rakuten.ne.jp/gold/auc-mikawa-kiko/images/20airman/enhl036_03.jpg" width="300"></td>
<td>
<div class="product_title_sub2">
ウォークスルーデッキ</div>
<p style="width: 300px; float: left">
作業に便利なウォークスルーデッキを採用。前後どちらからでも乗り降りが可能です。</p>
<img alt="" height="81" src="http://www.rakuten.ne.jp/gold/auc-mikawa-kiko/images/20airman/enhl036_04.jpg" width="100">
<div class="product_title_sub2" style="clear: both">
低床で乗り降りがらくらく<font style="color: #f00">【特許出願中】</font></div>
<p style="width: 300px; float: left">
油圧機器、バッテリを作業床の床下に収納することで、シザース型にもかかわらず、わずか54cmの低床を実現し、ワンステップで乗降りが可能です。</p>
<img alt="" height="131" src="http://www.rakuten.ne.jp/gold/auc-mikawa-kiko/images/20airman/enhl036_05.jpg" width="100">
<div class="product_title_sub2" style="clear: both">
足踏みパーキングブレーキを装備</div>
<p style="width: 300px; float: left">
安全装置の一つとして足踏みパーキングブレーキを装備しています。</p>
<img alt="" height="114" src="http://www.rakuten.ne.jp/gold/auc-mikawa-kiko/images/20airman/enhl036_06.jpg" width="100">
<div class="product_title_sub2" style="clear: both">
下部フレームが自動接地<font style="color: #f00">【特許出願中】</font></div>
<p>
作業（上昇）時にフレームの４点が自動接地するため、シザース構造と相まって抜群の安定感を実現します。</p>
<p>
<img alt="" height="103" src="http://www.rakuten.ne.jp/gold/auc-mikawa-kiko/images/20airman/enhl036_07.jpg" width="400"></p>
